import React from 'react'

class Index extends React.Component{
    constructor(){
        super();
        this.state = {
            loginForm: false,
            signinForm: false
        }
    }

    render(){
        return( 
            <>
            <button className="loginButton" onClick={()=>this.setState({loginForm: !this.state.loginForm}), stopPropagation()}>
            {this.state.loginForm? 
            <div>
                <input type="text" placeholder="Enter Username"/>
            </div>
            : "Login to Start"}
            </button>
            </>
        );
    }
}

export default Index;
